
File References:
- Static Swift:
  - AppDelegate.swift
  - ViewController.swift
  - ModelThing.h
  - ModelThing.m
  - Main.storyboard:
    - Base
  - Assets.xcassets
  - LaunchScreen.storyboard:
    - Base
  - Info.plist
- Products:
  - Static.app
  - Dynamic.app
- Pods:
  - Pods-Abstract Target-iOS Pods-Dynamic.debug.xcconfig
  - Pods-Abstract Target-iOS Pods-Dynamic.release.xcconfig
  - Pods-Abstract Target-iOS Pods-Static.debug.xcconfig
  - Pods-Abstract Target-iOS Pods-Static.release.xcconfig
- Frameworks:
  - Pods_Abstract_Target_iOS_Pods_Dynamic.framework
  - libPods-Abstract Target-iOS Pods-Static.a



Targets:
- Static:
    Build Phases:
    - "[CP] Check Pods Manifest.lock":
        Input File List Paths: []
        Input Paths:
        - "${PODS_PODFILE_DIR_PATH}/Podfile.lock"
        - "${PODS_ROOT}/Manifest.lock"
        Output File List Paths: []
        Output Paths:
        - "$(DERIVED_FILE_DIR)/Pods-Abstract Target-iOS Pods-Static-checkManifestLockResult.txt"
        Shell Path: "/bin/sh"
        Shell Script: |
          diff "${PODS_PODFILE_DIR_PATH}/Podfile.lock" "${PODS_ROOT}/Manifest.lock" > /dev/null
          if [ $? != 0 ] ; then
              # print error to STDERR
              echo "error: The sandbox is not in sync with the Podfile.lock. Run 'pod install' or update your CocoaPods installation." >&2
              exit 1
          fi
          # This output is used by Xcode 'outputs' to avoid re-running this script phase.
          echo "SUCCESS" > "${SCRIPT_OUTPUT_FILE_0}"
    - Sources:
      - ViewController.swift
      - ModelThing.m
      - AppDelegate.swift
    - Frameworks:
      - libPods-Abstract Target-iOS Pods-Static.a
    - Resources:
      - LaunchScreen.storyboard
      - Assets.xcassets
      - Main.storyboard
    Build Configurations:
    - Debug:
        Build Settings:
          ASSETCATALOG_COMPILER_APPICON_NAME: AppIcon
          CLANG_ENABLE_MODULES: 'YES'
          CLANG_ENABLE_OBJC_WEAK: 'YES'
          CODE_SIGN_STYLE: Automatic
          INFOPLIST_FILE: Static Swift/Info.plist
          LD_RUNPATH_SEARCH_PATHS: "$(inherited) @executable_path/Frameworks"
          PRODUCT_BUNDLE_IDENTIFIER: me.segiddins.Static-Swift
          PRODUCT_NAME: "$(TARGET_NAME)"
          SWIFT_OPTIMIZATION_LEVEL: "-Onone"
          SWIFT_VERSION: '4.0'
          TARGETED_DEVICE_FAMILY: '1,2'
        Base Configuration: Pods-Abstract Target-iOS Pods-Static.debug.xcconfig
    - Release:
        Build Settings:
          ASSETCATALOG_COMPILER_APPICON_NAME: AppIcon
          CLANG_ENABLE_MODULES: 'YES'
          CLANG_ENABLE_OBJC_WEAK: 'YES'
          CODE_SIGN_STYLE: Automatic
          INFOPLIST_FILE: Static Swift/Info.plist
          LD_RUNPATH_SEARCH_PATHS: "$(inherited) @executable_path/Frameworks"
          PRODUCT_BUNDLE_IDENTIFIER: me.segiddins.Static-Swift
          PRODUCT_NAME: "$(TARGET_NAME)"
          SWIFT_VERSION: '4.0'
          TARGETED_DEVICE_FAMILY: '1,2'
        Base Configuration: Pods-Abstract Target-iOS Pods-Static.release.xcconfig
